import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
function App() {
    return (
        <>
            <Router>
                <Switch>
                    <Route path="/" exact>
                        <Users />
                    </Route>
                    <Route path="/" exact>
                        <Users />
                    </Route>
                </Switch>
            </Router>
            <h1>App</h1>
        </>
    );
}

export default App;
